choices.text:
parser.parseArray(componentType, array, fieldName);
/*
 * BUG:
 * return (T) array.toArray();
 * FIXED:
 */

parser.accept(JSONToken.LBRACKET);
if (lexer.token() != JSONToken.RBRACKET) {
    int index = 0;
    do {
        Object val;
        if (componentType == Byte.TYPE || componentType == Byte.class) {
            val = lexer.byteValue();
            lexer.nextToken(JSONToken.COMMA);
        } else {
            val = parser.parseObject(componentClass, index);
        }
        array.add(val);
        ++index;
    } while (lexer.token() == JSONToken.COMMA);
}
parser.accept(JSONToken.RBRACKET);

parser.parseArray(componentType, array, fieldName);
if (componentClass == byte.class) {
    byte[] bytes = new byte[array.size()];
    for (int i = 0; i < array.size(); ++i) {
        Object obj = array.get(i);
        if (obj == null) {
            bytes[i] = 0;
        } else {
            bytes[i] = TypeUtils.castToByte(obj);
        }
    }
    return (T) bytes;
}
Object[] objs = (Object[]) Array.newInstance(componentClass, array.size());
if (componentClass == char.class) {
    for (int i = 0; i < objs.length; ++i) {
        Object value = array.get(i);
        if (value == null) {
            objs[i] = '\0';
        } else {
            objs[i] = TypeUtils.castToChar(value);
        }
    }
} else {
    for (int i = 0; i < objs.length; ++i) {
        Object value = array.get(i);
        if (value == null && componentClass.isPrimitive()) {
            throw new JSONException("unable to cast to : " + componentClass.getName());
        }
        objs[i] = value;
    }
}

